	(958,123,'<span class=\"lorem\">A few words of introduction for this project are coming very soon... </span>','<p><span class=\"lorem\">A few words of introduction for this project are coming very soon&#8230; </span></p>\n'),
	(942,122,'For their company website, O+CO, a brand consultancy in New York City, was looking for a unique experience of their own brand.\r\n\r\nUsing vector shapes to define particle boundaries, grey-scale bitmaps for particle densities, voronoi diagrams for circle-packing areas and collision, in partnership with the team at O+CO, we devised a fully parametric animation. The result was subtle but striking, a brand experience that only the digital medium could provide.\r\n\r\n\r\n\r\n','<p>For their company website, O+CO, a brand consultancy in New York City, was looking for a unique experience of their own brand.</p>\n\n<p>Using vector shapes to define particle boundaries, grey-scale bitmaps for particle densities, voronoi diagrams for circle-packing areas and collision, in partnership with the team at O+CO, we devised a fully parametric animation. The result was subtle but striking, a brand experience that only the digital medium could provide.</p>\n'),
	(953,63,'<span class=\"lorem\">A few words of introduction for this project are coming very soon... </span>','<p><span class=\"lorem\">A few words of introduction for this project are coming very soon&#8230; </span></p>\n'),
