	(1044,62,'<span class=\"lorem\">A few words of introduction for this project are coming <em>very</em> soon... </span>\r\n','<p><span class=\"lorem\">A few words of introduction for this project are coming <em>very</em> soon&#8230; </span></p>\n'),
	(951,61,'<span class=\"lorem\">A few words of introduction for this project are coming very soon... </span>','<p><span class=\"lorem\">A few words of introduction for this project are coming very soon&#8230; </span></p>\n'),
	(948,50,'##### We created a __comprehensive__ brand architecture and naming system to organize the new brand’s services in a way customers could clearly understand.\r\n\r\nWe then brought the brand to life with a compelling visual system. With these key brand assets in place, we designed and launched a new website and new tools to help both brokers and employees articulate the new brand purpose and promise.','<h5>We created a <strong>comprehensive</strong> brand architecture and naming system to organize the new brand’s services in a way customers could clearly understand.</h5>\n\n<p>We then brought the brand to life with a compelling visual system. With these key brand assets in place, we designed and launched a new website and new tools to help both brokers and employees articulate the new brand purpose and promise.</p>\n'),
	(946,36,'<span class=\"lorem\">A few words of introduction for this project are coming very soon... </span>','<p><span class=\"lorem\">A few words of introduction for this project are coming very soon&#8230; </span></p>\n'),
	(947,120,'<span class=\"lorem\">A few words of introduction for this project are coming very soon... </span>','<p><span class=\"lorem\">A few words of introduction for this project are coming very soon&#8230; </span></p>\n'),
	(943,26,'#### Milo Health is a healthcare tool to help employers and employees stay healthy.\r\nEngaging tracking employees\r\n','<h4>Milo Health is a healthcare tool to help employers and employees stay healthy.</h4>\n\n<p>Engaging tracking employees</p>\n'),
	(945,141,'<span class=\"lorem\">A few words of introduction for this project are coming very soon... </span>','<p><span class=\"lorem\">A few words of introduction for this project are coming very soon&#8230; </span></p>\n'),
	(1045,67,'<span class=\"lorem\">A few words of introduction for this project are coming very soon... </span>','<p><span class=\"lorem\">A few words of introduction for this project are coming very soon&#8230; </span></p>\n'),
	(949,39,'<span class=\"lorem\">A few words of introduction for this project are coming very soon... </span>','<p><span class=\"lorem\">A few words of introduction for this project are coming very soon&#8230; </span></p>\n'),
	(1043,121,'###### When an update for the Graduate Computer Art Department at SVA website was required, one of their most important recruiting tools, I tried to let shine one of their most important assets, past student work.\r\n\r\nAll while avoiding being overwhelmed by SVA\'s already powerful brand, yet allowing to transpire the spirit of the department in the small details.\r\n','<h6>When an update for the Graduate Computer Art Department at SVA website was required, one of their most important recruiting tools, I tried to let shine one of their most important assets, past student work.</h6>\n\n<p>All while avoiding being overwhelmed by SVA&#8217;s already powerful brand, yet allowing to transpire the spirit of the department in the small details.</p>\n'),
	(955,60,'<span class=\"lorem\">A few words of introduction for this project are coming very soon... </span>','<p><span class=\"lorem\">A few words of introduction for this project are coming very soon&#8230; </span></p>\n'),
	(1050,912,'##### Lorem ipsum dolor sit amet, consectetuer adipiscing elit.\r\n\r\nAenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Donec quam felis, ultricies nec, pellentesque eu, pretium quis, sem. Nulla consequat massa quis enim. Donec pede justo, fringilla vel, aliquet nec, vulputate eget, arcu. In enim justo, rhoncus ut, imperdiet a, venenatis vitae, justo. ','<h5>Lorem ipsum dolor sit amet, consectetuer adipiscing elit.</h5>\n\n<p>Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Donec quam felis, ultricies nec, pellentesque eu, pretium quis, sem. Nulla consequat massa quis enim. Donec pede justo, fringilla vel, aliquet nec, vulputate eget, arcu. In enim justo, rhoncus ut, imperdiet a, venenatis vitae, justo.</p>\n');
