INSERT INTO `folio_entries_data_66` (`id`, `entry_id`, `value`, `value_formatted`)
VALUES
	(238,123,'## le-meridien colors:\r\nbackground-color:hsl(45, 5%, 75%); color:hsl(45, 5%, 35%)\r\n\r\n##### A six feet interface with a real-time data feed displayed in the lobbies of SAP\'s offices around the world.',NULL),
	(231,39,'box-shadow:0px 9px 12px -3px rgb(0,0,0);\r\nbox-shadow:0 0 1px 0 hsl(210,2%,30%) inset;\r\nbox-shadow:none;\r\nborder:1px solid hsl(210, 2%, 30%);\r\ncolor:hsl(210, 2%, 70%)',NULL),
	(230,50,'To complete the transformation of GHI and HIP under the EmblemHealth brand umbrella, we created a comprehensive brand architecture and naming system to organize the new brand’s services in a way customers could clearly understand. ',NULL),
	(225,122,'O+CO –[Oppenheimer and Company Brand Consultants](http://www.oandco.com/)– helps leaders create brands that deliver a positive impact in organizations, markets, and communities.\r\n  - Generated Animation\r\n  - Boundaries created with On-the-fly shapes\r\n  - Fine-tuning of every aspect\r\n\r\n1660;\r\nbackground-color: hsl(210, 4%, 0%); color: hsl(224, 3%, 50%)\r\nbackground-color: hsl(210, 4%, 5%); color: hsl(224, 3%, 55%)\r\nborder: 1px solid hsl(224, 3%, 10%); box-shadow: none; ',NULL),
	(323,121,'All while avoiding being overwhelmed by SVA\'s already powerful brand, yet allowing to transpire the spirit of the department in the small details.\r\n\r\n# Lorem ipsum dolor sit amet\r\n\r\nConsectetuer adipiscing elit. Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Donec quam felis, ultricies nec, pellentesque eu, pretium quis, sem. Nulla consequat massa quis enim. Donec pede justo, fringilla vel, aliquet nec, vulputate eget, arcu. In enim justo, rhoncus ut, imperdiet a, venenatis vitae, justo. Nullam dictum felis eu pede mollis pretium. Integer tincidunt. Cras dapibus. Vivamus elementum semper nisi. Aenean vulputate eleifend tellus.',NULL),
	(235,63,'#### La Redoute makes french style accessible to all\r\n\r\nLa Redoute makes french style accessible to all — with stylish looks and timeless pieces - plus guidance and advice on how to look good. You get a great choice of clothes that fit well and flatter —the way only the French seem to know how. All our communications; website, catalogue, mailings and emails, give you useful ideas, tips and best buys. The prices make it great value too and it\'s all delivered straight to your door. That\'s what we call French style made easy.\r\n\r\n1. [La Redoute Corporate](https://www.laredoute-corporate.com/en/)\r\n2. [La Redoute UK](https://www.laredoute.co.uk/)\r\n\r\n\r\nclassname: browser; background-color:hsl(10, 10%, 98%); color:hsl(200, 10%, 40%)',NULL),
	(234,66,'#### Alternet built this Interactive Video Platform in 2006 to leverage the skyrocketing consumer demand\r\n\r\nFor online video and tap into powerful new sources of revenue from Internet video advertising and syndication.',NULL),
	(233,61,'Alternet built this Interactive Video Platform in 2006 to leverage the skyrocketing consumer demand for online video and tap into powerful new sources of revenue from Internet video advertising and syndication.',NULL),
	(232,65,'###### Alternet built this Interactive Video Platform in 2006 to leverage the skyrocketing consumer demand for online video and tap into powerful new sources of revenue from Internet video advertising and syndication.',NULL),
	(229,120,'#### Le Méridien is an upscale, design-focused international hotel brand.\r\n\r\nWith a European perspective, formerly headquartered in France and in the United Kingdom.',NULL),
	(228,36,'box-shadow:0px 6px 12px -3px rgb(0,0,0)\r\n##### A full service asset management firm, focused on the entire investment life cycle, including Asset Management, Development & Construction Management and Property Management.',NULL),
	(227,141,'##### Freeplay Music _specifications_ With a wide variety of high-quality music and world-class customer service.\r\n--link-color:hsl(292, 90%, 100%);\r\n--alt-background-color:hsl(45, 7%, 68%); ',NULL),
	(226,64,'#### Accessible and easy-to-understand licensing process.\r\n\r\n[Freeplay Music](http://freeplaymusic.com/) is one of the most trusted production music libraries in the world.  With a wide variety of high-quality music and world-class customer service, we have clients from all over the world who use our music in everything from personal web videos to major network television broadcasts and major feature films.',NULL),
	(324,67,'background-color:#bbbab4;\r\nbox-shadow:0px 6px 12px -3px #000000\r\n\r\n##### A part of the team that implemented a complete rebranding with a striking and colorful visual identity.\r\n\r\nUsing watercolor-like illustration for the third-largest contact lens manufacturer in the world.',NULL),
	(329,912,'--alt-background-color:hsl(45, 1%, 75%); \r\n\r\n# H1 Header 1\r\n## H2\r\n### H3\r\n#### H4\r\n##### H5\r\n###### H6\r\n\r\nNullam dictum felis eu pede mollis pretium. Integer tincidunt. Cras dapibus. Vivamus elementum semper nisi. Aenean vulputate eleifend tellus.',NULL);
